  false,\n\t\"url\": null,\n\t\"notes\": \"Data and information collected by the submersible
  Johnson Sea-Link II at waypoints along its track during nineteen dives of the 2007
  \"Operation Deep Scope\" expedition sponsored by the National Oceanic and Atmospheric
  Administration (NOAA) Office of Ocean Exploration, August 17 through August 27,
  2007. Measurements and information include sub's position and depth; personnel assignments;
  dive, mission, target, and vehicle ID's; dive comments; hyperlinks to CTD plots;
  water temperature; and salinity. The Marine Operations Division of the Harbor Branch
  Oceanographic Institution provided the original submersible data.\",\n\t\"owner_org\":
